create table users (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	tokenVerify VARCHAR(50),
	orientation VARCHAR(50),
	username VARCHAR(50),
	password VARCHAR(50),
	avatar VARCHAR(50),
	rating INT,
	lat VARCHAR(50),
	lon VARCHAR(50),
	complete VARCHAR(50),
	birthdate DATE
);
